// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./Admined.sol";

contract ModifiableSoul is Admined {
    mapping(uint256 => bytes32) private _soulModifications;
    mapping(uint256 => Donor) private _specialDonorMods;

    struct Donor {
        uint8[] donorType;
        // 1 = developer
        // 2 = auditor
        // 3 = investor
        // 4 = designer
        // 5 = marketer
        // 6 = evangelist
        // 7 = unicorn
        // 8 = journalist
        // 9 = blogger
        // 10 = pornostar
    }

    uint8 private _maxModVal; // max 255
    uint8 private _maxMods; // max 32

    mapping(address => uint256) private _accountWeights;

    event ModificationSetted(
        address indexed from,
        uint256 indexed tokenId,
        bytes32 mods
    );

    function _setModificationSettings(uint8 maxModVal, uint8 maxMods)
        public
        onlyAdmin
    {
        require(maxModVal < 255);
        require(maxMods < 32);

        _maxModVal = maxModVal; // init 1
        _maxMods = maxMods; // init 4
    }

    function modificationSettings() public view returns (uint8, uint8) {
        return (_maxModVal, _maxMods);
    }

    /**
     * @dev Gets the modification of the specified token ID
     * @param soulId uint256 ID of the token
     * @return uint256 modifications mask
     */
    function _getSoulModifications(uint256 soulId)
        internal
        view
        returns (bytes32)
    {
        require(_exists(soulId));
        return _soulModifications[soulId];
    }

    /**
     * 0..511
     */
    function _multiplier(
        uint256 soulId,
        uint8 incMod,
        uint8 decMod
    ) internal view returns (uint8) {
        uint256 inc = uint256(_getMod(soulId, incMod));
        uint256 dec = uint256(_getMod(soulId, decMod));

        return uint8(inc + (255 - dec));
    }

    /**
     * @param soulId uint256 ID of the token
     * @param modNumber from 0 to 31
     */
    function _getMod(uint256 soulId, uint8 modNumber)
        internal
        view
        returns (uint8)
    {
        bytes32 modifications = _getSoulModifications(soulId);
        return uint8(modifications[modNumber]);
    }

    function _toBytes32(bytes memory source)
        internal
        pure
        returns (bytes32 result)
    {
        assembly {
            result := mload(add(source, 32))
        }
    }

    function _toBytes(bytes32 source) internal pure returns (bytes memory) {
        return abi.encodePacked(source);
    }

    function _increaseMod(
        uint256 soulId,
        uint8 modNumber,
        uint8 val
    ) internal {
        bytes32 currentMods = _getSoulModifications(soulId);
        uint8 mod = uint8(currentMods[modNumber]);

        require(val > 0);
        require(val <= _maxModVal);
        require(mod <= (255 - val));

        bytes memory newMods = _toBytes(currentMods);
        newMods[modNumber] = bytes1(mod);

        _soulModifications[soulId] = _toBytes32(newMods);
    }

    function _decreaseMod(
        uint256 soulId,
        uint8 modNumber,
        uint8 val
    ) internal {
        bytes32 currentMods = _getSoulModifications(soulId);
        uint8 mod = uint8(currentMods[modNumber]);

        require(val > 0);
        require(val <= _maxModVal);
        require(mod >= val);

        bytes memory newMods = _toBytes(currentMods);
        newMods[modNumber] = bytes1(mod);

        _soulModifications[soulId] = _toBytes32(newMods);
    }

    function _setModification(uint256 soulId, bytes32 modification) internal {
        uint8 modCounter = 0;
        for (uint8 i = 0; i < 32; i++) {
            uint8 modValue = uint8(modification[i]);
            if (modValue > 0 && modValue <= _maxModVal) {
                _increaseMod(soulId, 1, modValue);
                if (++modCounter <= _maxMods) {
                    break;
                }
            }
        }
        emit ModificationSetted(tx.origin, soulId, modification);
    }

    function _setDonorMod(uint256 soulId, uint8 typeMod) internal onlyAdmin {
        _specialDonorMods[soulId].donorType.push(typeMod);
    }

    function _getDonorMod(uint256 soulId)
        internal
        view
        returns (uint8[] memory)
    {
        Donor memory specMod = _specialDonorMods[soulId];
        return specMod.donorType;
    }
}

